import React from "react";
import "./Contacts.css";

export const Contact = () => (
  <div class="contact_page">
    <button type="button" class="btn btn-lg btn-so">
      <i class="fab fa-stack-overflow pr-1"></i>
      <span>Stack Overflow</span>
    </button>
  </div>
);
